INSERT INTO `comics` (`COMIC_ID`, `USER_ID`, `COMIC_NAME`, `SHORT_DESCRIPTION`, `TOTAL_CHAPTERS`, `COVER`, `TYPE`, `CREATE_AT`, `UPDATE_AT`) VALUES
(5, 1, 'TẠ U THIÊN SƯ', 'Tạ U từ khi sinh ra đã là thiên tà phù hộ bách quỷ chúc phúc...... Nhưng mà quỷ quái chúc phúc cùng thiện ý đối với nhân loại mà nói cũng không phải là chuyện tốt. căn cứ khế ước năm đó, Tạ U chỉ có thể tiếp tục giả bộ tàn phế làm một người mù thêm người què, dưới tình huống như vậy để cho năm nhà thực hiện hôn ước, nếu như có một nhà không thể thực hiện, như vậy Tạ U sẽ thành người mù chân chính.', 5, , 'Comic', '2023-05-23 21:46:41', '2023-06-05 20:43:25');
INSERT INTO `comics` (`COMIC_ID`, `USER_ID`, `COMIC_NAME`, `SHORT_DESCRIPTION`, `TOTAL_CHAPTERS`, `COVER`, `TYPE`, `CREATE_AT`, `UPDATE_AT`) VALUES
(6, 1, 'TỪ CHỨC NGHIỆP YẾU NHẤT TRỞ THÀNH \'\' THỢ RÈN\'\' MẠNH NHẤT', 'Con người của thế giới này được Thượng đế ban cho nghề nghiệp và vũ khí được gọi là Thần khí. Vũ khí con người tự tạo ra là rác thải. Đó là lý do tại sao, những nghề bị người đời khinh bỉ nhất là “Thợ rèn”, người có thể chế tạo và sửa đổi vũ khí. Nhân vật chính Relius đã có là kẻ xui xẻo khi được ban cho Chức Nghiệp yếu nhất đó,nhưng thực chất không phải vậy .Đọc chap mới tại fanpage Hikki Team.', 2, , 'Comic', '2023-05-23 21:57:05', '2023-06-05 20:43:10');
INSERT INTO `comics` (`COMIC_ID`, `USER_ID`, `COMIC_NAME`, `SHORT_DESCRIPTION`, `TOTAL_CHAPTERS`, `COVER`, `TYPE`, `CREATE_AT`, `UPDATE_AT`) VALUES
(7, 1, 'ÂM DƯƠNG SƯ MẠNH NHẤT TÁI SINH Ở THẾ GIỚI KHÁC', 'Onmyoji mạnh nhất trong lịch sử, người thành thạo tất cả các kỹ thuật tâm linh và đi cùng với thức thần của Mười hai vị tướng thiên đường, bị gia đình phản bội và chết một cách bi thảm. Tuy nhiên, trên bờ vực của cái chết của mình, anh ta đã mở một vòng tròn chuyển giới để tái sinh ở một thế giới khác. Onmyoji mạnh nhất trở thành con trai thứ ba, Wayne, một quý tộc cấp cao trên thế giới này. Trong thế giới này sau khi tái sinh, khái niệm [Phép thuật] được sử dụng rộng rãi và sự vượt trội hay thấp kém của một địa vị được xác định bởi sự hiện diện hay vắng mặt của khả năng ma thuật.', 1, , 'Comic', '2023-06-02 14:07:39', '2023-06-05 20:39:50');
INSERT INTO `comics` (`COMIC_ID`, `USER_ID`, `COMIC_NAME`, `SHORT_DESCRIPTION`, `TOTAL_CHAPTERS`, `COVER`, `TYPE`, `CREATE_AT`, `UPDATE_AT`) VALUES
(8, 1, 'Arifureta Shokugyou de Sekai Saikyou', 'Nagumo Hajime là『 đứa bị bắt nạt 』 , cùng bạn cùng lớp đồng thời bị triệu hoán tới thế giới khác. Tuy các bạn cùng lớp liên tiếp được tiếp nhận các thiên chứ  chiến đấu với năng lực thần thánh, nhưng Hajime lại chỉ cầm giữ thiên chức «Biến Đổi Sư» với năng lực bình thường. Với chỉ có một kĩ năng duy nhất. Bị mọi người trong lớp chế giễu và bắt nạt vì yếu đuối, cậu mau tuyệt vọng. Liệu cậu có thể sinh tồn trong thế giới nguy hiểm đầy rẫy quái vật và ác quỷ với sức mạnh chỉ ngang thợ rèn hay không?', 1, , 'Light-Novel', '2023-06-02 18:28:36', '2023-06-02 18:29:14');
INSERT INTO `comics` (`COMIC_ID`, `USER_ID`, `COMIC_NAME`, `SHORT_DESCRIPTION`, `TOTAL_CHAPTERS`, `COVER`, `TYPE`, `CREATE_AT`, `UPDATE_AT`) VALUES
(9, 1, 'Kiếm Ý Hoá Hình', 'Một nhà sáng chế mô hình 3D 28 tuổi có trình độ tương đương với 40 năm kinh nghiệm làm việc đã được tái sinh vào thế giới giả tưởng, mà tại đây nghề sửa kiếm và máy móc là số 1... Ký kết hệ thống đúc kiếm, hắn ta có thể tải bản đồ kiếm của từ các thế giới khác và có thể sử dụng. Ầy thật là, thế giới này quá đơn giản đối với một người chế tạo như hắn, bất kể là đúc kiếm hay biến hình...Nói chung hắn có thể hóa hình kiếm theo ý muốn, ghê chưa ghê chưa.', 0, , 'Comic', '2023-06-04 21:56:32', '2023-06-04 21:57:12');
INSERT INTO `comics` (`COMIC_ID`, `USER_ID`, `COMIC_NAME`, `SHORT_DESCRIPTION`, `TOTAL_CHAPTERS`, `COVER`, `TYPE`, `CREATE_AT`, `UPDATE_AT`) VALUES
(10, 1, 'Cao Võ Hạ Cánh Đến Một Vạn Năm Sau', 'Khi võ thuật lần đầu tiên phát triển mạnh mẽ, những con thú ngoài hành tinh đáng sợ đã xâm chiếm và các chiến binh loài người dần dần rút lui. Lu Sheng xuyên qua và bước vào thế giới 10.000 năm sau trong giấc mơ của anh ấy — kỹ thuật luyện thân cơ bản 10.000 năm sau đã được sửa đổi, và hiệu quả mạnh hơn bây giờ gấp ngàn lần! Vạn năm sau, hô hấp phương pháp, luyện thân phương thuốc, võ công kinh thư... Vạn năm võ đạo về sau, nhân loại diệt vong. Nền văn minh võ học đã nhân lên đến đỉnh cao là không ai thừa kế. Lu Sheng là tia lửa duy nhất! [Biên tập độc quyền/chịu trách nhiệm: Hứa Thanh]', 0, , 'Comic', '2023-06-04 21:58:23', '2023-06-04 21:58:47');
INSERT INTO `comics` (`COMIC_ID`, `USER_ID`, `COMIC_NAME`, `SHORT_DESCRIPTION`, `TOTAL_CHAPTERS`, `COVER`, `TYPE`, `CREATE_AT`, `UPDATE_AT`) VALUES
(11, 1, 'Cửa hàng sủng thú siêu thần', 'Thời đại sủng thú, thực lực của sủng thú quyết định tất cả! Mọi chiến sủng sư đều cố gắng từ từ nâng cao thực lực của sủng thú. Cho đến khi 1 tiệm sủng thú thần bí ra đời! Sự bồi dưỡng trong vài ngày ngắn ngủi, vậy mà bộ xương cấp thấp lại có thể một nhát chém chết hoàng kim cự long?! Con chó gác cổng lại mang trên người bí kĩ của thập đại sủng thú?! Em gái làm công trông tiệm thậm chí còn tự xưng là thần...Còn ông chủ Tô Bình: bồi dưỡng 1 con manh sủng đáng yêu thành vương thú thời tiền sử, lẽ nào đây không phải là thao tác thông thường?', 0, , 'Comic', '2023-06-05 20:37:11', '2023-06-05 20:37:55');
INSERT INTO `comics` (`COMIC_ID`, `USER_ID`, `COMIC_NAME`, `SHORT_DESCRIPTION`, `TOTAL_CHAPTERS`, `COVER`, `TYPE`, `CREATE_AT`, `UPDATE_AT`) VALUES
(12, 1, 'Nguyên Tôn', 'Một tác phẩm mới của Thiên Tằm Thổ Đậu\r\nTa có một ngụm Huyền Hoàng Khí, có thể nuốt thiên địa nhật nguyệt tinh.\r\n.........\r\nLúc đó đường về, đã là một con đường vận mệnh treo ngược.\r\nNgày xưa vinh hoa, như thay đổi khôn lường, một giấc ác mộng dài.\r\nThiếu niên chấp bút, Long Xà bay động.\r\nLà vì một vòng quang mang bổ ra dáng vẻ nặng nề chi loạn thế, vấn đỉnh điện ngọc thương khung.\r\nĐường báo thù, cùng ta đồng hành.\r\nMột ngụm Huyền Hoàng chân khí nhất định nuốt thiên địa nhật nguyệt tinh thần, hùng thị cỏ cây thương sinh.\r\nThiết họa tịch chiếu, vụ ải ngân câu, bút tẩu du long xông Cửu Châu.\r\nHoành tư thiên hạ, mực vẩy thanh sơn, thôn tính biển hồ nạp trăm sông.', 0, , 'Comic', '2023-06-05 20:38:59', '2023-06-05 20:39:29');
