(257, 42, NULL, NULL, '<h3>Ánh sáng đang tắt dần trong màn đêm đen đặc. Hai cánh tay cậu chới với giữa khoảng không trong khi cảm giác hụt hẫng khó tin khiến vùng hạ bộ co lại, và vẻ mặt Nagumo Hajime biến dạng kinh hoàng trong khi luồng sáng rời xa khỏi tầm mắt cậu.</h3>\n\n<h3>Hiện tại, Hajime đang rơi từ trên một vách đá xuống vực thẳm sâu hun hút như lối dẫn tới địa ngục. Ánh sáng soi rọi độc nhất là những tia le lói đến từ mặt đất trên cao. Chuyến thám hiểm mê cung đã kết thúc bằng việc Hajime trượt chân xuống kẽ nứt khổng lồ này. Khi những chấm sáng vụt tắt và không gian xung quanh hoàn toàn tối đen như mực, những gì cậu có thể nhận thức là tiếng gió thổi hun hút và khung cảnh xoay mòng mòng như khi xem một chiếc đèn kéo quân[1].</h3>\n\n<h3>Trải qua biết bao bất công khi đặt chân đến thế giới này, một người con Nhật Bản như cậu thật khó mà biểu lộ những từ ngữ dạt dào hi vọng và mơ ước thần thoại trước nỗi bất hạnh mà cậu vẫn không ngừng nếm trải tới bây giờ.</h3>\n\n<h3>Thứ hai. Thời điểm bắt đầu cái ngày chán nản nhất trong tuần. Đại đa số mọi người chỉ biết thở dài ngao ngán nhớ lại quãng thời gian thần tiên của mấy hôm trước.</h3>\n\n<h3>Điều này với Nagumo Hajime cũng không phải là ngoại lệ. Tuy nhiên trong trường hợp của cậu thì nỗi phiền muộn không chỉ dừng ở đó. Trường học gợi nên cảm giác tồi tệ thiếu thoải mái và bản thân nó dư sức khiến cậu phải sầu não khôn nguôi.</h3>\n\n<h3>Vẫn như mọi khi, khoảnh khắc tiếng chuông đầu tiết bắt đầu ngân vang thì cũng là lúc Hajime có mặt và kéo cửa lớp đi vào. Toàn thân cậu rã rời sau một đêm thức trắng không ngủ.</h3>\n\n<h3>Đáp lại cậu là những cái liếc xéo và tặc lưỡi của đa số các nam sinh. Các nữ sinh cũng không tỏ vẻ thân thiện gì mấy. Tất cả đều chĩa mũi dùi khinh miệt vào cậu, khiến cậu không khỏi ao ước sao bọn chúng không phớt lờ cậu quách đi cho xong.</h3>\n\n<h3>Hajime lỉnh thật nhanh đến chỗ ngồi của mình, song vẫn có những kẻ luôn tìm cách ngáng đường cậu như thường lệ.</h3>\n\n<h3>“Êê, Kimoota! Lại thức đêm chơi game hả mày? Chắc lại cày eroge phỏng?”</h3>\n\n<h3>“Úi, tởm chết mẹ~ Cày eroge suốt đêm thì tởm chết mẹ thật bây ơi ~”</h3>\n\n<h3><em>Tao tự hỏi rốt cuộc có cái gì đáng cười với lũ đực rựa tụi bay ở đây thế?</em>&nbsp;Kẻ bày trò gây sự với cậu có tên là Hiyama Daisuke, là đầu têu đám móc mỉa Hajime mỗi ngày không biết chán. Ba tên đầu bò cợt nhả ở gần đó lần lượt là Saitou Yoshiki, Kondou Reiichi và Nakano Shinji. Tổng cộng bốn thằng này thường xuyên kiếm chuyện với Hajime</h3>\n\n<h3>Như Hiyama nói, Hajime là một otaku. Tuy nhiên, vẻ ngoài và cách hành xử của cậu không phải là nguyên nhân khiến cậu bị chế giễu bởi cái biệt danh Kimoota. Tóc cậu luôn được cắt ngắn gọn ghẽ và chưa bao giờ cậu quên chải đầu trước khi học. Tuy thiếu chủ động và quyết đoán nhưng cậu vẫn trả lời người khác rành mạch. Tính cách cậu trầm lặng nhưng không khiến người khác phải ưu phiền. Chỉ đơn giản là cậu có niềm ưa thích với manga, tiểu thuyết, game và phim ảnh mà thôi.</h3>\n\n<h3>Cho dù xã hội có thành kiến không nhỏ với giới otaku, cái cảm giác kì thị đó chưa bao giờ vượt lên mức độ thù nghịch ra ngoài mặt. Vậy nguyên do gì toàn bộ các nam sinh lại tỏ ra căm ghét và đối đầu với cậu đến như vậy?</h3>\n\n<h3>Câu trả lời chính là cô ấy.</h3>\n\n<h3>“Chào buổi sáng, Nagumo-kun! Vẫn suýt soát như mọi khi nhỉ. Lần sau hãy đến sớm hơn nhé!”</h3>\n\n<h3>Một nữ sinh hiếm hoi tươi cười tiến lại chỗ của Hajime. Là một trong số ít những ngoại lệ của lớp, à không – của khắp cả trường đối xử thân thiện với Hajime, cô ấy chính là nguyên nhân dẫn đến tình cảnh hiện tại của cậu.</h3>\n\n<h3>Tên cô ấy là Shirasaki Kaori. Được ca tụng là một trong hai đại nữ thần của trường, sắc đẹp mơn mởn khiến cô ấy được các nam sinh lẫn nữ sinh mến mộ cuồng nhiệt. Mái tóc đen dài óng ả chấm thắt lưng cùng cặp mắt to tròn long lanh gợi cảm giác dịu dàng. Sống mũi dọc thanh mảnh được tô điểm bởi cặp môi anh đào mọng nước xinh xắn.</h3>\n\n<h3>Thường xuyên được bạn học – cho dù không cùng năm – quan tâm nhờ cậy, cô ấy có tinh thần trách nhiệm lớn và sẵn sàng giúp đỡ người khác với nụ cười thường trực ở trên môi. Khó mà tin rằng một người như thế mới chỉ là một học sinh cao trung – một thiếu nữ luôn dùng thái độ chân thành giải quyết mọi chuyện không chút phiền lòng.</h3>\n\n<h3>Một người như Kaori tại sao lại để ý đến Hajime? Là một học sinh vô tích sự luôn gà gật trong lớp vì mải thâu đêm suốt sáng (thành tích học tập do vậy cũng chỉ ở mức trung bình), cậu nghĩ mình lọt vào tầm ngắm của Kaori cũng do bản tính thương người của cô mà nên.</h3>\n\n<h3>Thật ra nếu thái độ học tập của Hajime có trở nên khá khẩm hơn, hoặc đối tượng quan tâm của Kaori là một gã bảnh trai thì có lẽ đã không thành vấn đề; đáng tiếc Hajime chỉ có ngoại hình bình thường, cộng với phương châm “sống vì sở thích” càng góp phần cô lập cậu với số đông còn lại. Một người như Hajime mà được gần gũi với Kaori, tất nhiên sẽ không thể không khiến bọn nam sinh “bình thường” khác nảy sinh lòng ghen tị. “Vì sao chỉ có mỗi thằng Hajime?!” Các nữ sinh thì đồ rằng cậu cố tình làm phiền Kaori bằng cách không chịu sửa đổi bản thân, thế nên họ cũng không lấy làm thoải mái với cậu.</h3>\n\n<h3>“C-Ch-Chào buổi sáng, Shirasaki-san.”</h3>\n\n<h3><em>Ui chao, sát khí ở đâu nổi lên thế này!?</em>&nbsp;Lời chào đáp lễ của cậu nhanh chóng nhận được vô số tia nhìn hăm họa từ xung quanh.</h3>\n\n<h3>Biểu cảm của Kaori liền lộ vẻ tươi vui.&nbsp;<em>Tại sao lại là nét mặt ấy cơ chứ?!</em>&nbsp;Những tia nhìn trân trối như muốn xuyên thủng da thịt khiến Hajime toát mồ hôi lạnh. Không biết bao nhiêu lần Hajime đã tự hỏi mình câu hỏi đó. Tại sao Kaori, thiếu nữ xinh đẹp nhất trường, lại để ý đến cậu? Trong mắt Hajime, bản tính của Kaori dường như còn một khía cạnh khác mà nhất thời cậu vẫn chưa hiểu ra được.</h3>\n\n<h3>Tuy nhiên, không khi nào cậu dám mơ tưởng rằng khía cạnh đó chính là cảm xúc tình yêu. Hajime chấp nhận từ bỏ nhận thức bản thân trong nhiều mặt để có thể theo đuổi sở thích của bản thân – do vậy diện mạo, điểm số và khả năng vận động của cậu chỉ đạt mức trung bình. Khi đem so sánh với đám con trai tài giỏi ở bên cạnh Kaori thì Hajime hoàn toàn không có cửa. Thế nên, thái độ của cô ấy vẫn còn là một ẩn số với cậu.</h3>\n\n<h3><em>Thiệt tình, làm ơn nhận ra một rừng ánh mắt tràn ngập sát ý ở xung quanh đi!</em>! Hajime rên thầm trong bụng song không dám hó hé nửa lời. Một nước cờ sai và cậu sẽ được áp tải ra sau nhà tập thể thao trong nháy mắt...</h3>\n\n<h3>Đang loay hoay tìm cách kết thúc cuộc trò chuyện thì ba học sinh khác tiến đến chỗ Hajime. Một trong số đó thuộc nhóm “con trai tài giỏi” mà cậu vừa nhắc đến ban nãy.</h3>\n\n<h3>“Chào buổi sáng. Nagumo-kun. Vất vả cho cậu mỗi ngày quá nhỉ.”</h3>\n\n<h3>“Kaori vẫn còn bận tâm đến cậu ta à? Thiệt tình, Kaori đúng là tốt bụng quá đấy.”</h3>\n\n<h3>“Khổ ghê, có nói gì với cái tên chán đời này cũng không ăn thua đâu.”</h3>\n\n<h3>Người duy nhất chào hỏi cậu trong cả ba là một nữ sinh tên Yaegashi Shizuku. Cô ta là bạn thân nhất của Kaori. Đặc điểm nhận diện là mái tóc đuôi ngựa đen dài, cùng đồng tử hẹp sắc sảo song nội tâm gợi cảm giác êm dịu, khiến ấn tượng ban trở nên cuốn hút thay vì là lãnh đạm.</h3>\n\n<h3>Là một thiếu nữ có thân hình săn chắc với chiều cao 172 cm, cơ thể Shizuku toát nên thần thái tôn nghiêm tựa như các samurai thời xưa. Thực tế, nhà cô ta có mở một võ đường truyền dạy kiếm pháp phái Yaegashi, và Shizuku chưa từng phải chịu thất bại trong các đại hội kiếm đạo được tổ chức từ thời học tiểu học. Hiện tại, Shizuku liên tục xuất hiện trên các tạp chí dưới hình tượng nữ kiếm sĩ xinh đẹp, thu hút một lượng fan cuồng không nhỏ. Không khó để có thể bắt gặp cảnh tượng các nữ sinh cấp dưới trìu mến gọi cô ta là “Onee-sama” với vẻ mặt hân hoan và cặp mắt rực cháy niềm kính phục.</h3>\n\n<h3>Kế tiếp, kẻ hỏi han Kaori bằng cái giọng thum thủm đó là Amanogawa Kouki. Một đấng anh hùng với cái tên rực rỡ thật xứng tầm. Một nhân vật có vẻ ngoài hấp dẫn, thành tích học tập xuất sắc và khả năng thể thao thì đỉnh của đỉnh.</h3>\n\n<h3>Với thân hình thân đối và chiều cao xấp xỉ 180 cm, Kouki mang một ánh mắt hiền từ bên dưới mái tóc nâu óng ánh. Cậu ta tốt bụng với bất cứ ai và luôn rạo rực ý thức chính nghĩa (theo ý kiến cá nhân là có phần cực đoan). Kouki là môn sinh của võ đường Yaegashi kể từ hồi học tiểu học, và cũng giống Shizuku, cả hai đều là các nhà vô địch toàn quốc. Kouki là bạn thời thơ ấu của Shizuku. Được hàng tá nữ sinh theo đuổi, nhưng vì luôn ở bên cạnh Shizuku và Kaori nên các cô gái cũng rụt rè mà không dám bày tỏ tình cảm. Cho dù vậy, khoảng dăm bữa nửa tháng con người nổi tiếng này vẫn đều đều nhận được thư tỏ tình đến từ bên ngoài trường.</h3>\n\n<h3>Cuối cùng là một nam sinh tạo cảm giác tùy tiện có tên là Sakagami Ryuutarou, bạn chí cốt của Kouki. Mang mái tóc cắt ngắn hợp với ánh mắt hớn hở và thân hình lực lưỡng như một con gấu có chiều cao 190 cm, đương sự thuộc tuýp xác to não bé không bận tâm tới những chi tiết cỏn con bên ngoài.</h3>\n\n<h3>Chỉ có thiện cảm với những người gan dạ, nhiệt huyết và luôn phấn đấu, thế nên trong mắt Ryuutarou thì Hajime – một kẻ chán đời đến trường chỉ để ngủ – rơi vào tuýp người mà cậu ta ghét nhất. Thực tế là sau khi liếc qua Hajime và cười gằn một tiếng thì đương sự hoàn toàn phớt lờ sự hiện diện của cậu.</h3>\n\n<h3>“Chào buổi sáng, Yaegashi-san, Amanogawa-kun, Sakagami-kun. Haha, chậc, tôi vốn đã thế nên đành chịu thôi chứ biết sao.”</h3>\n\n<h3>Hajime cười gượng chào lại nhóm Shizuku. Lại thêm vài cái lườm nguýt và chửi xéo, “Thằng khốn. Ai cho mày được phép nói chuyện với Yaegashi-san hả?” Nguyên do là Shizuku cũng được hâm mộ cuồng nhiệt không kém Kaori là bao.</h3>\n\n<h3>“Đã biết vậy sao cậu còn không chịu sửa đổi bản thân chứ? Cậu còn tính dựa dẫm vào Kaori đến bao giờ đây? Kaori không chỉ phải quan tâm đến mỗi mình cậu đâu đấy!”</h3>\n\n<h3>Kouki lên giọng giáo huấn Hajime. Trong mắt của cậu ta, Hajime thiếu chân thành khi tiếp nhận lòng tốt của Kaori.&nbsp;<em>Làm như tôi muốn dựa dẫm vào người khác lắm!? Hãy để cho tôi yên đi!</em>&nbsp;Suýt chút nữa là cậu đã lên tiếng cự nự, nhưng kết quả của việc đó sẽ là một vé tốc hành đưa Hajime đến nhà vệ sinh trong tương lai gần. Hơn nữa Kouki vốn rất cứng rắn với lập trường của mình, thế nên Hajime đành im lặng vì biết cãi nhau cũng chẳng nên cơm cháo gì cả.</h3>\n\n<h3>Mà nói sửa là sửa thế nào chứ? Vốn dĩ Hajime từ lâu đã đặt sở thích làm trọng tâm cuộc sống bản thân. Cha cậu là một nhà phát triển game và mẹ cậu là một shoujo mangaka, thế nên hiện tại cậu đang đi làm thêm cho cả công ty của cha và phụ việc ở chỗ mẹ, lấy kinh nghiệm làm tiền đề sau này.</h3>\n\n<h3>Tập trung sở thích xoay quay mục tiêu để cùng lúc trui rèn kĩ năng cá nhân là chiến lược của cậu. Do đã suy nghĩ đủ chín chắn cho tương lai thế nên Hajime cảm thấy không vì lời nói của ai khác mà phải thay đổi phong cách sống hiện tại. Nếu Kaori mà không để ý đến cậu thì Hajime đã có thể trải qua quãng đời học sinh yên bình được rồi.</h3>\n\n<h3>“Đâu phải ~, ahaha...”</h3>\n\n<h3>Hajime cười giả lả mong cho qua chuyện. Song nữ thần vẫn vô tư thả một quả bom ngay giữa hội nghị như mọi khi.</h3>\n\n<h3>“? Kouki-kun nói gì lạ vậy? Mình nói chuyện với Nagumo-kun là vì mình muốn thế cơ mà.”</h3>\n\n<h3><em>Bùm</em>, và lớp học trở nên xôn xao. Bọn nam sinh nghiến răng nhìn chằm chằm như muốn băm vằm Hajime, và hội bốn tên của Hiyama bắt đầu suy nghĩ không biết nên áp tải Hajime đến chỗ nào trong giờ nghỉ trưa sắp tới.</h3>\n\n<h3>“Hơ?... Aa, Kaori đúng là tốt bụng thật nhỉ.”</h3>\n\n<h3>Kouki dường như chấp nhận cách hiểu rằng Kaori chỉ có ý quan tâm đến Hajime. Một kẻ “tài giỏi” như cậu ta chỉ vì quá cương trực nên mắc khuyết điểm là không thể nhận ra mặt trái của mọi chuyện.&nbsp;<em>Thật phiền phức</em>&nbsp;– Hajime lơ đãng ngắm nhìn trời xanh qua khung cửa sổ như muốn thoát khỏi thực tại trước mắt.</h3>\n\n<h3>“... Xin lỗi nhé. Không phải là hai người họ có ác ý gì đâu...”</h3>\n\n<h3>Shizuku, người hiểu rõ nhất các mối quan hệ cá nhân và tính cách từng người ở đây, len lén xin lỗi Hajime. Cậu nhún vai, “đành chịu vậy,” và nở một nụ cười bất lực.</h3>\n\n<h3>Khi tiếng chuông đầu tiết ngân vang thì giáo viên cũng đã có mặt tại lớp. Hajime nhanh chóng hòa nhịp vào bầu không khí kì lạ xung quanh trong khi giáo viên điểm qua các thông báo buổi sáng. Thời điểm tiết học bắt đầu cũng là lúc Hajime chính thức chìm vào cõi mộng như mọi khi.</h3>\n\n<h3>Trông bộ dạng Hajime như vậy, Kaori nhoẻn miệng cười, Shizuku cũng mỉm cười đầy ý nghĩa, bọn nam sinh thì cắn môi khó chịu, còn các nữ sinh thì ném những cái nhìn khinh miệt về phía cậu.</h3>\n\n<h3>Tiếng ồn ào của lớp học đã đưa Hajime trở về với thực tại. Thói quen gà gật ở trường khiến cơ thể cậu hình thành cơ chế tự đánh thức bản thân vào lúc cần thiết. Và lúc cần thiết ở đây chính là khi giờ nghỉ trưa bắt đầu.</h3>\n\n<h3>Sau mười giây “sạc điện” cho cơ thể rệu rã, Hajime vươn vai lôi bentou từ trong cặp ra. Số học sinh mua đồ ăn ngoài đã nhanh chân rời khỏi lớp từ trước. Những người còn lại trong phòng, ngoài nhóm chuẩn bị bentou giống Hajime chiếm khoảng hai phần ba sĩ số, còn có giáo viên xã hội học dạy tiết tư Hatakeyama Aiko (hai mươi lăm tuổi) đang đứng trên bục giảng trò chuyện với vài học sinh khác.</h3>\n\n<h3><em>-Juruu, kyupon![2]</em></h3>\n\n<h3>Sau đúng mười giây nạp xong năng lượng cho buổi chiều, Hajime nằm vật ra bàn toan chuẩn bị ngủ tiếp. Khốn thay, kẻ phá bĩnh với gương mặt tươi cười của nữ thần – mà trong mắt Hajime không khác gì là ác quỷ – lại đang tiến đến chỗ cậu.</h3>\n\n<h3>“<em>Thôi chết tôi</em>,” Hajime than thầm trong bụng. Thứ hai đầu tuần bao giờ cũng là ngày cậu thiếu ngủ dữ dội nhất. Nếu như mọi khi, trước khi nhóm Kaori kịp đến bắt chuyện thì cậu đã lẻn ra ngoài đến một chỗ vắng trước để đánh một giấc say sưa. Hậu quả của hai ngày đêm thức trắng liên tục giờ đã bộc phát khiến cậu phải nếm mùi đau khổ.</h3>\n\n<h3>“Nagumo-kun. Hiếm thấy cậu ở lớp thật đấy. Bentou? Nếu được thì chúng ta ăn cùng nhau nhé.”</h3>\n\n<h3>Bầu không khí căng như dây đàn lại bao trùm khắp căn phòng.&nbsp;<em>Mèn đét ơi, khi khôn răng lại để ý đến ngộ là sao?</em>&nbsp;Hajime thầm rủa trong bụng bằng thứ phương ngữ kì lạ mà cậu suýt buột mồm nói ra.</h3>\n\n<h3>Hajime loay hoay tìm cách từ chối.</h3>\n\n<h3>“Cảm ơn vì lời mời, Shirasaki-san. Nhưng tôi vừa mới ăn xong, hay là cậu đến ăn với nhóm của Amanogawa-kun có được không?!”</h3>\n\n<h3>Nói xong, Hajime chìa hộp bentou rỗng như xác ướp ra cho cô ấy xem. Thà bị người khác chửi sau lưng, “Thằng này là ai mà tỏ vẻ trịch thượng vậy?!” còn hơn là bị hành xác bởi trăm ngàn cặp mắt săm soi đến hết giờ nghỉ trưa.</h3>\n\n<h3>Thế nhưng, mức độ phản kháng cỡ đó chỉ là muỗi đốt trước đòn công kích của nữ thần.</h3>\n\n<h3>“Ếế! Cậu chỉ ăn trưa thế này thôi ư? Không được, cậu phải ăn nhiều hơn nữa! Để mình sẻ bớt phần bentou của mình qua!”</h3>\n\n<h3><em>Tha cho tôi đi mà! Làm ơn nhận ra đi! Làm ơn nhận ra bầu không khí xung quanh đi!</em></h3>\n\n<h3>Trong khi áp lực bốn phía ngày càng nặng nề khiến Hajime toát mồ hôi lạnh thì cứu tinh của cậu đã tới. Đó là nhóm của Kouki.</h3>\n\n<h3>“Kaori. Đến đây ăn chung với bọn mình nào. Nagumo dường như vẫn chưa tròn giấc thì phải. Mình tuyệt đối không bỏ qua nếu hộp bentou ngon lành mà Kaori đã cất công chuẩn bị lại do một kẻ thiếu ngủ thưởng thức đâu.”</h3>\n\n<h3>Kouki tươi cười nói bằng một giọng ra chiều hợm hĩnh trong khi Kaori mắt tròn mắt dẹt. Đối với một cô gái thiếu nhạy bén như Kaori thì nụ cười của gã đẹp mã Kouki không thể phát huy hiệu quả như ý được.</h3>\n\n<h3>“Ê? Không bỏ qua? Ý của Kouki-kun là sao?”</h3>\n\n<h3>Shizuku phì cười trước câu đối đáp hồn nhiên của Kaori. Kouki cũng đành cười xòa chữa thẹn và tiếp tục câu chuyện. Áp lực bốn phía đè nặng lên Hajime chẳng hề vơi đi khi mà bốn nhân vật nổi tiếng nhất trường rốt cuộc đều đang quây quần xung quanh chỗ cậu.</h3>\n\n<h3>Hajime thở dài, lầm bầm trong bụng.</h3>\n\n<h3><em>Sao không ai triệu hồi mấy người đến thế giới khác đi!? Nhìn kiểu gì thì bốn người các người đều đang say sưa trong thế giới của riêng mình... Làm ơn, có ông thần nào, cô công chúa nào, hay cô vu nữ nào triệu hồi họ đến thế giới khác giùm tôi đi ~~</em></h3>\n\n<h3>Lảm nhảm về một thế giới khác là cách mà Hajime dùng để trốn tránh thực tại. Toan đánh bài chuồn quen thuộc bằng cách thoái thác khỏi cuộc chuyện trò rồi đứng dậy để tìm chỗ trốn như mọi khi... thì Hajime bỗng nhiên sững sờ đến ngây người.</h3>\n\n<h3>Đập vào mắt Hajime là một hoa văn hình học và vòng tròn trắng tinh sáng lấp lánh xuất hiện ngay dưới chân của Kouki. Các học sinh ở xung quanh cũng lập tức nhận ra hiện tượng dị thường này. Hajime tiếp tục quan sát thứ hoa văn lấp lánh dường như trói chặt mọi người xuống đất, khiến cậu liên tưởng đến một khái niệm phi thường – đây là một&nbsp;<em>trận địa ma thuật</em>.</h3>\n\n<h3>Trận địa ma thuật bắt đầu phát sáng và chỉ trong khoảnh khắc đã mở rộng choán hết cả căn phòng. Khi vòng tròn đã vươn đến ngay dưới chân, các học sinh dường như mới choàng tỉnh và thét lớn. Aiko-sensei ở trong phòng khi đó la lên, “Các em, rời khỏi đây ngay!” song chưa kịp dứt lời thì trận địa ma thuật rực sáng như phát nổ.</h3>\n\n<h3>Sau vài giây, rồi vài phút, căn phòng rực rỡ ánh sáng trở về với diện mạo nguyên thủy, thế nhưng mọi mầm sống bên trong đã biến mất. Tất cả các vật dụng không hề suy suyển: những chiếc ghế bị đá tung, những hộp bentou đang ăn dở, những chiếc đũa vương vãi ở dưới đất cùng mấy chai nhựa PET đựng nước; song toàn bộ con người bên trong lớp học dường như đã bốc hơi không chút dấu vết.</h3>\n\n<h3>Sự kiện này được thế giới ghi nhận là hiện tượng mất tích bí ẩn hàng loạt tại trường trung học vào giữa ban ngày, song hãy tạm gác vấn đề này sang một bên trước đã.</h3>', '2023-06-02 20:00:19', NULL),
